import React from "react";
import "./style.css";

const Card = ({ recipe }) => {
  return (
    <div className="recipe">
      <h3 className="recipe">{recipe.name}</h3>
      <p className="recipe">
        {recipe.type} - {recipe.author}
      </p>
      <hr />
    </div>
  );
};

export default Card;
